import styled from 'styled-components';

export const ContentStyled = styled.div`
	position: relative;
	height: ${(props) => (props.playing ? 'calc(100vh - 60px)' : '100vh')};
	padding-top: 100px;
	padding-bottom: 60px;
	width: 100vw;
	background: ${({ theme }) => theme.white};
`;
